import Navbar from "./navbar"
import Slider from "./slider"


const Photogrid = () => {
    return(
        <article>
        <Navbar/>
    <section className = "photogrid">
            <h1 className = "carosellotitolo"> le nostre foto </h1>
            <Slider></Slider>
            </section>
            </article>) }


export default Photogrid;
